import React from 'react';
import ReactDOM from 'react-dom/client';
import './assets/styles/homepage.css'
import logo42 from './assets/images/logo-42.png';

export function Homepage()
{
	return (
		<>
		<div id='mainContainer'>
			<header id='topSide'>
				<h1 id='homePageTitle'>Web Serv</h1>
				<img id='logo42' src={logo42} alt='logo42'></img>
			</header>
			<main>
				<p id=''>Web serv is a 42 project that consist to build a HTTP server from scratch, it has to be powered in C++</p>
				<button>Start</button>
			</main>
			<footer>
				<div id='footerUpperPart'>
					<p>Coded by</p>
				</div>
				<div id='footerLowerPart'>
					<p>Urbain Dumas</p>
					<p>Vincent Da Conceicao Ramos</p>
				</div>
			</footer>
		</div>
		</>
	);
}
